import React from 'react';
import * as S from './style';
import { ReactComponent as CheckedIcon } from '../icons/check-on.svg.svg';
import { ReactComponent as UncheckedIcon } from '../icons/check-off.svg.svg';

const Checkbox = ({ checked = false, onClick }) => {
    return (
        <S.Wrapper onClick={onClick}>
            {checked ? <CheckedIcon width={36} height={36} /> : <UncheckedIcon width={36} height={36} />}
        </S.Wrapper>
    );
};

export default Checkbox;
